import React from 'react';
import Carousel from '../../assets/imageSlider/Carousel.tsx';

const ImageSlider = () => {
  return (
    <div>
      <Carousel
        autoPlay={true}
        animation="slide"
        indicators={true}
        timeout={500}
        navButtonsAlwaysVisible={true}
      >
        <img src="" alt="Imagem 1" />
        <img src="" alt="Imagem 2" />
        <img src="" alt="Imagem 3" />
      </Carousel>
    </div>
  );
}

export default ImageSlider;
